import React from 'react'
import Link from 'next/link'

const Index = () =>{
    return (
        <div>
            <img className="bg-cover bg-center absolute" src='/main-img.png' />
            <h1>Jeferson Rocha</h1>
            <Link href="/about"><a>About</a></Link>
        </div>
    )
}

export default Index
